import React,{useState, useEffect} from 'react'
import axios from 'axios';
import { useRefresh } from '../context/RefreshContext';
import { useUserContext } from '../context/UserContext';
const EventsJoined = () => {

    const [events, setEventList] = useState([]);
    const { UserId } = useUserContext();
    const { refreshEventList } = useRefresh();
  
    console.log("User in EventsJoined-->",UserId);
    
    useEffect(() => {
        axios.get(`/api/getJoinedEvents/${UserId}`)
            .then(response => {
              if (response.status === 200) {
                console.log("Response Data-->", response.data);
                setEventList(response.data);
                console.log("Eventlist", events);
            }
            })
            .catch(error => {
                console.error('Error fetching event list:', error);
            })
  
}, [  refreshEventList ]);
    
  return (
    <div className='eventlistmain'>
    <h3 className='explore'>My Events</h3>
    <ul className='eventlist'>
           <li className='eventitem card myeventcard' >
                      <div className="eventhead">
                        <div className="eventtitle">
                        <h2>Festival</h2>
                        </div>
                      <div className='joined'>
                         <img alt="" src="data:image/png;base64," />
                       <span>1000</span>
                       </div>
                      </div>
                      <div className="eventmid">
                      <p>Category: Music</p>
                      <p>Location: 39/40, Hosur Road, Bangalore</p>
                      <p>Date: 20-04-2024 (Weekday)</p>
                      <p>Time: 04:00PM to 10:00PM </p>
                      <p className='desc'>Description: Lorem ipsum dolor, sit amet.Lorem ipsum dolor, sit amet.</p>
                      <p>Attendees: 200</p>
                      <p>Organizer: Akash kumar Das</p>
                      </div>
                      <div className="btn">
                        <button>Joined</button>
                        <button className='moreinfobtn'>Edit Info</button>
                        <button className='deletebtn moreinfobtn'></button>
                      </div>
              </li>    
              {events.map(event => (
                  <li className='eventitem card' key={event._id}>
                       <div className="eventhead">
                       <div className="eventtitle">
                        <h2>{event.name}</h2>
                      </div>
                      <div className='joined'>
                         <img alt='' src="data:image/png;base64," />
                       <span>{event.joined > 0 ? event.joined : 0}</span>
                       </div>
                      </div>
                      <div className="eventmid">
                      <p>Category: {event.category}</p>
                      <p>Location: {event.location}</p>
                      <p>Date: {event.date}</p>
                      <p>Time: {event.startTime} - {event.endTime}</p>
                      <p className='desc'>Description: {event.description}</p>
                      <p>Attendees: {event.attendees}</p>
                      <p>Organizer: {event.organizerName}</p>
                      </div>
                      <div className="btn">
                        <button>Join</button>
                        <button className='moreinfobtn'>More Info</button>
                        {/* <button className='deletebtn moreinfobtn' onClick={()=>handleDelete(event._id)}></button> */}
                      </div>
                  </li>
              ))}
          </ul>
    </div>
  )
}

export default EventsJoined
